function Movie() {
  return (
    <div className="movie">
      <h2>{movies.title}</h2>
      <p>릴리스 날짜: {movies.release_date}</p>
      <p>{movies.overview}</p>
      <p>평점: {movies.vote_average}</p>
      {/* 필요한 다른 영화 정보를 표시할 수 있습니다. */}
    </div>
  );
}

export default Movie;
